SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS  `xg_dist_record`;
CREATE TABLE `xg_dist_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(11) NOT NULL DEFAULT '0' COMMENT 'appid',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `xj_userid` int(11) NOT NULL DEFAULT '0' COMMENT '下级id',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单id',
  `money` decimal(10,3) NOT NULL COMMENT '金额',
  `level` tinyint(1) NOT NULL DEFAULT '0' COMMENT '当前给他的级别是几级分销',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1 good_order表中的 2 rooms_order表中',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='终端用户的分销记录';

DROP TABLE IF EXISTS  `xg_app_num`;
CREATE TABLE `xg_app_num` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `app_num` int(11) NOT NULL COMMENT '数量',
  `price` decimal(28,2) NOT NULL COMMENT '价格',
  `type_auto` tinyint(1) NOT NULL COMMENT '1(超管身份)2（代理商身份）',
  `type_ssh` tinyint(1) NOT NULL COMMENT '1（代理商）2（普通用户）',
  `user_system` int(11) NOT NULL COMMENT '管理员id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_user`;
CREATE TABLE `xg_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nickName` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `openid` varchar(28) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `gender` smallint(1) unsigned NOT NULL DEFAULT '0',
  `avatarUrl` varchar(256) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `city` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `province` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `country` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0',
  `apps` int(8) unsigned NOT NULL,
  `is_forbidden` tinyint(1) NOT NULL COMMENT '当前用户是否被禁用，在总后台设置',
  `p_id` int(11) NOT NULL DEFAULT '0' COMMENT '当前用户的上级用户id',
  `money` decimal(10,3) NOT NULL COMMENT '用户分销的金额',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=241 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC;

DROP TABLE IF EXISTS  `xg_app_setting`;
CREATE TABLE `xg_app_setting` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `type` tinyint(4) NOT NULL COMMENT '小程序类型',
  `price` varchar(32) NOT NULL COMMENT '价格',
  `year_num` int(11) NOT NULL COMMENT '年数',
  `type_auto` tinyint(1) NOT NULL COMMENT '1(超管身份)2（代理商身份）',
  `type_ssh` tinyint(1) NOT NULL COMMENT '1（代理商）2（普通用户）',
  `user_system` int(11) DEFAULT NULL COMMENT '管理员id',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_s` (`id`),
  KEY `n_mol` (`type`,`price`,`year_num`,`type_auto`,`type_ssh`,`user_system`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_goods`;
CREATE TABLE `xg_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(8) unsigned NOT NULL DEFAULT '0',
  `name` varchar(32) NOT NULL DEFAULT '',
  `pic` varchar(2000) NOT NULL DEFAULT '',
  `desc` varchar(600) NOT NULL DEFAULT '',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00',
  `dis_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00',
  `spec` text NOT NULL,
  `stock` int(11) NOT NULL DEFAULT '0',
  `cid` char(64) NOT NULL DEFAULT '',
  `is_deliver` smallint(1) unsigned NOT NULL DEFAULT '0',
  `content_show` smallint(1) unsigned NOT NULL DEFAULT '0',
  `content` text NOT NULL,
  `create_time` int(11) unsigned NOT NULL DEFAULT '0',
  `custom_id` int(11) unsigned NOT NULL DEFAULT '0',
  `code` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=116 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_subscribe_order`;
CREATE TABLE `xg_subscribe_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `user_id` int(11) unsigned NOT NULL COMMENT 'ID',
  `subscribe_id` int(11) unsigned NOT NULL COMMENT '服务项目id',
  `service_user_id` int(11) unsigned DEFAULT NULL COMMENT '服务人员id',
  `appid` int(11) unsigned NOT NULL COMMENT '预约程序id',
  `price` varchar(30) NOT NULL COMMENT '单价',
  `subscribe_name` varchar(32) NOT NULL COMMENT '服务名称',
  `subscribe_time` int(11) NOT NULL COMMENT '预约时间时间戳',
  `username` char(30) NOT NULL COMMENT '预约人姓名',
  `tel` char(30) NOT NULL COMMENT '预留手机号',
  `remark` varchar(32) NOT NULL DEFAULT '0' COMMENT '留言',
  `state` tinyint(1) NOT NULL COMMENT '状态0(预约成功，待处理)1(后台已确定)2 后台已取消 3 已完成',
  `create_time` int(11) unsigned NOT NULL COMMENT '创建时间',
  `end_time` int(11) NOT NULL COMMENT '预约结束的时间',
  `order_sn` varchar(32) NOT NULL COMMENT '当前的订单号',
  `order_pic` varchar(56) NOT NULL COMMENT '存储一张照片，查找的时候不用循环找',
  PRIMARY KEY (`id`),
  UNIQUE KEY `sy_id` (`id`),
  KEY `sy_index` (`subscribe_time`,`remark`,`user_id`,`subscribe_id`,`service_user_id`,`username`,`tel`,`state`),
  KEY `sy_num` (`subscribe_name`,`price`)
) ENGINE=InnoDB AUTO_INCREMENT=427 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_custom`;
CREATE TABLE `xg_custom` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nickname` varchar(255) NOT NULL DEFAULT '',
  `username` char(15) NOT NULL DEFAULT '',
  `password` varchar(32) NOT NULL DEFAULT '',
  `wallet` decimal(28,2) NOT NULL DEFAULT '0.00',
  `expense` decimal(28,2) NOT NULL DEFAULT '0.00',
  `last_time` int(11) NOT NULL DEFAULT '0',
  `ip` char(20) NOT NULL DEFAULT '',
  `app_num` int(11) NOT NULL DEFAULT '0',
  `max_app_num` int(11) NOT NULL DEFAULT '1',
  `register_time` int(11) NOT NULL DEFAULT '0',
  `is_forbidden` tinyint(1) NOT NULL COMMENT '当前用户是否禁用，在总后台设置',
  `is_agency` tinyint(1) NOT NULL COMMENT '1（审核中）2（通过）3（未通过）',
  `agency_realname` varchar(32) NOT NULL COMMENT '姓名',
  `is_agency_user` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是代理商 0(不是)1(是)',
  `id_cart` varchar(32) NOT NULL COMMENT '身份证号',
  `is_belong` tinyint(2) NOT NULL COMMENT '0(超级管理员下)1（代理商下）',
  `id_agency` int(11) NOT NULL COMMENT '代理商id',
  `angency_number` int(11) DEFAULT NULL COMMENT '代理商可以添加的普通用户的数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

DROP TABLE IF EXISTS  `xg_rooms_order`;
CREATE TABLE `xg_rooms_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `openid` varchar(32) NOT NULL COMMENT '用户的openid',
  `appid` int(11) NOT NULL COMMENT '小程序id',
  `rooms_id` int(11) NOT NULL COMMENT '房间id',
  `stores_id` int(11) NOT NULL COMMENT '门店id',
  `order_sn` varchar(32) NOT NULL COMMENT '订单号',
  `room_type` varchar(32) NOT NULL COMMENT '房间类型',
  `price` decimal(28,2) NOT NULL COMMENT '单价',
  `num` varchar(11) NOT NULL COMMENT '天数',
  `total_fee` decimal(28,2) NOT NULL COMMENT '实际支付',
  `user_money` decimal(28,2) NOT NULL COMMENT '余额支付金额',
  `total_price` decimal(28,2) NOT NULL COMMENT '总价',
  `bed_type` varchar(32) NOT NULL COMMENT '床铺类型',
  `start_time` int(11) NOT NULL COMMENT '开始入住时间',
  `end_time` int(11) NOT NULL COMMENT '入住结束时间',
  `create_time` int(11) NOT NULL COMMENT '订单生成时间',
  `username` varchar(32) NOT NULL COMMENT '入住人姓名',
  `user_tel` varchar(32) NOT NULL COMMENT '入住人联系方式',
  `address` varchar(32) NOT NULL COMMENT '酒店地址',
  `prepay_id` varchar(255) NOT NULL COMMENT '如果订单走过支付流程，微信的支付id',
  `prepay_time` varchar(32) NOT NULL COMMENT '支付时间',
  `state` tinyint(4) NOT NULL COMMENT '状态0未付款，1已付款，2已退款 3(入住，订单结束）4（退款中）5（离开）',
  `remark` varchar(32) NOT NULL COMMENT '备注',
  `is_refunds` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否退款0（默认）1（已退款））',
  `refund_msg` varchar(255) NOT NULL COMMENT '退款理由',
  `is_delete` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否取消',
  `door_number` varchar(32) NOT NULL COMMENT '酒店自身门牌号',
  `in_time` int(11) NOT NULL COMMENT '入住时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `v_id` (`id`),
  UNIQUE KEY `v_old` (`order_sn`),
  KEY `v_nomal` (`user_id`,`openid`,`appid`,`stores_id`,`room_type`,`total_price`,`bed_type`,`start_time`,`end_time`,`create_time`),
  KEY `v_nomals` (`username`,`user_tel`,`address`,`prepay_id`,`prepay_time`,`state`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_goods_cart`;
CREATE TABLE `xg_goods_cart` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0',
  `good_id` int(11) unsigned NOT NULL DEFAULT '0',
  `pic` varchar(200) DEFAULT '',
  `num` int(11) unsigned NOT NULL DEFAULT '0',
  `name` char(32) NOT NULL DEFAULT '',
  `price` decimal(11,2) unsigned NOT NULL DEFAULT '0.00',
  `dis_price` decimal(11,2) unsigned NOT NULL DEFAULT '0.00',
  `spec_key` smallint(3) unsigned DEFAULT NULL,
  `spec_value` varchar(32) DEFAULT '',
  `cid` int(11) NOT NULL DEFAULT '0',
  `is_deliver` smallint(1) unsigned NOT NULL DEFAULT '0',
  `appid` int(8) unsigned NOT NULL DEFAULT '0',
  `custom_id` int(11) unsigned NOT NULL DEFAULT '0',
  `is_pay` smallint(1) unsigned NOT NULL DEFAULT '0',
  `order_id` int(11) NOT NULL,
  `is_cart` smallint(1) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=434 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='购物车';

DROP TABLE IF EXISTS  `xg_system_oauth`;
CREATE TABLE `xg_system_oauth` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` varchar(32) NOT NULL DEFAULT '',
  `appsecret` varchar(32) NOT NULL DEFAULT '',
  `token` varchar(32) NOT NULL DEFAULT '',
  `key` varchar(43) DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

DROP TABLE IF EXISTS  `xg_template`;
CREATE TABLE `xg_template` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(8) unsigned NOT NULL DEFAULT '0',
  `custom_id` int(11) unsigned NOT NULL DEFAULT '0',
  `title` varchar(64) NOT NULL,
  `keyword_name_list` varchar(256) NOT NULL DEFAULT '',
  `template_id` varchar(128) NOT NULL DEFAULT '',
  `time` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=112 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

DROP TABLE IF EXISTS  `xg_system_site`;
CREATE TABLE `xg_system_site` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL DEFAULT '',
  `url` varchar(255) NOT NULL DEFAULT '',
  `keyword` varchar(255) NOT NULL DEFAULT '',
  `description` varchar(500) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

DROP TABLE IF EXISTS  `xg_subscribe_service_setting`;
CREATE TABLE `xg_subscribe_service_setting` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `is_show_address` tinyint(1) NOT NULL,
  `is_show_tel` tinyint(1) NOT NULL,
  `button_name` varchar(125) NOT NULL,
  `appid` int(8) NOT NULL DEFAULT '0',
  `custom_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_rooms_refunds`;
CREATE TABLE `xg_rooms_refunds` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(11) NOT NULL,
  `user_id` int(11) NOT NULL COMMENT '微信用户id',
  `order_id` varchar(32) NOT NULL COMMENT '酒店订单id',
  `refunds_price` varchar(32) NOT NULL COMMENT '退款金额',
  `room_type` varchar(32) NOT NULL COMMENT '房间类型',
  `is_refund` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否退款0（未退款）1（已退款）',
  PRIMARY KEY (`id`),
  UNIQUE KEY `v_id` (`id`),
  KEY `v_nomal` (`appid`,`user_id`,`order_id`,`refunds_price`,`room_type`,`is_refund`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_rooms`;
CREATE TABLE `xg_rooms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(11) NOT NULL COMMENT '小程序id',
  `custom_id` int(11) NOT NULL COMMENT '用户id',
  `stores_id` varchar(32) NOT NULL COMMENT '门店id',
  `stores_type` int(11) NOT NULL COMMENT '1(特定门店)2（当前所有门店）',
  `room_type` varchar(10) NOT NULL COMMENT '房间类型',
  `number` int(11) NOT NULL COMMENT '数量',
  `price` varchar(32) NOT NULL COMMENT '价格',
  `man` int(11) NOT NULL COMMENT '容纳人数',
  `area` varchar(32) NOT NULL COMMENT '面积',
  `bed_type` varchar(32) NOT NULL COMMENT '床铺类型',
  `describe` varchar(32) NOT NULL COMMENT '描述',
  `facilities` text NOT NULL COMMENT '便利设施',
  `detail` text NOT NULL COMMENT '详情',
  `photo` text NOT NULL COMMENT '图片',
  `number_in` varchar(32) NOT NULL COMMENT '剩余数量',
  PRIMARY KEY (`id`),
  UNIQUE KEY `v_id` (`id`),
  KEY `v_nomal` (`appid`,`custom_id`,`room_type`,`stores_id`,`stores_type`,`number`,`price`,`man`,`area`,`bed_type`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_subscribe_service`;
CREATE TABLE `xg_subscribe_service` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `appid` int(11) NOT NULL,
  `service_pic` varchar(255) NOT NULL COMMENT '服务图片',
  `service_name` char(50) NOT NULL COMMENT '服务名称',
  `service_price` decimal(10,0) NOT NULL COMMENT '服务价格',
  `service_desc` varchar(255) NOT NULL COMMENT '服务概述\n',
  `service_particulars` text NOT NULL COMMENT '详情描述',
  `is_particulars` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否详情描述(默认''0''否,''1''是)',
  `custom_id` int(11) NOT NULL COMMENT '用户id\n',
  `cate_id` int(11) DEFAULT NULL COMMENT '分类id',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `sy_id` (`id`),
  KEY `sy_name` (`service_name`,`service_desc`,`service_price`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_withdraw_record`;
CREATE TABLE `xg_withdraw_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0',
  `appid` int(8) NOT NULL DEFAULT '0' COMMENT 'appid',
  `name` char(32) NOT NULL,
  `tel` char(11) NOT NULL DEFAULT '0' COMMENT '电话',
  `money` decimal(10,3) NOT NULL,
  `withdraw_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1 支付宝 2 银行卡',
  `ali_number` char(32) NOT NULL COMMENT '支付宝账号',
  `bank_name` char(32) NOT NULL COMMENT '银行卡的开户行',
  `bank_number` char(19) NOT NULL COMMENT '银行卡号',
  `is_audit` tinyint(4) DEFAULT '0' COMMENT '是否审核(''0''未审核,''1''已审核,''2''审核未通过)',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `success_time` int(11) NOT NULL DEFAULT '0' COMMENT '后台处理的时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=155 DEFAULT CHARSET=utf8 COMMENT='用户的提现表\n';

DROP TABLE IF EXISTS  `xg_goods_order`;
CREATE TABLE `xg_goods_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(8) unsigned NOT NULL DEFAULT '0',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0',
  `price` decimal(11,2) unsigned NOT NULL DEFAULT '0.00',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0',
  `order_sn` varchar(32) NOT NULL DEFAULT '',
  `carts` varchar(256) NOT NULL DEFAULT '',
  `state` smallint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0 未付款 1 已支付 2 已发货 3 已收货也就是已完成 4 退货 5 取消订单\n',
  `custom_id` int(11) unsigned NOT NULL DEFAULT '0',
  `username` char(32) NOT NULL DEFAULT '',
  `tel` char(15) NOT NULL DEFAULT '',
  `mail` char(32) NOT NULL DEFAULT '',
  `dist` char(32) NOT NULL DEFAULT '',
  `city` char(32) NOT NULL DEFAULT '',
  `province` char(32) NOT NULL DEFAULT '',
  `address` varchar(256) NOT NULL DEFAULT '',
  `zipcode` char(10) NOT NULL DEFAULT '',
  `remark` varchar(256) NOT NULL DEFAULT '',
  `prepay_id` varchar(64) NOT NULL DEFAULT '',
  `prepay_time` varchar(11) NOT NULL,
  `openid` varchar(28) NOT NULL,
  `name` varchar(64) NOT NULL,
  `pic` varchar(256) NOT NULL,
  `num` int(11) unsigned NOT NULL DEFAULT '0',
  `kd_number` char(30) NOT NULL DEFAULT '' COMMENT '快递单号',
  `kd_code` char(15) NOT NULL COMMENT '快递公司编码',
  `is_return` smallint(1) NOT NULL DEFAULT '0' COMMENT '0 未申请退款 1 一申请退款 后台未审核 2  后台审核通过 同时把state变为5 3 管理员不同意退款\n',
  `is_expire` smallint(1) NOT NULL DEFAULT '0' COMMENT '默认是0 只有任务计划执行完没有支付并且超过两小时的订单才会变成1',
  `user_money` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '当前订单用户是否使用余额，如果使用，这个就是使用了多少',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=278 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='订单表';


