DROP TABLE IF EXISTS  `xg_rooms_rules`;
CREATE TABLE `xg_rooms_rules` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `appid` int(11) NOT NULL COMMENT '小程序id',
  `custom_id` int(11) NOT NULL COMMENT '用户id',
  `stores_id` int(11) NOT NULL COMMENT '门店id',
  `name` varchar(32) NOT NULL COMMENT '名称',
  `start_time` int(11) NOT NULL COMMENT '开始时间',
  `over_time` int(11) NOT NULL COMMENT '结束时间',
  `is_restday` int(11) NOT NULL DEFAULT '0' COMMENT '将规则仅适用于此期间的每周六、周日\n1（适用）2（不适用）',
  `rules` tinyint(11) NOT NULL COMMENT '1(按比例涨价)2(固定金额涨价)',
  `rules_detail` varchar(32) NOT NULL COMMENT 'rules对应的详细价格rules为1时为比例，rules为2时为具体价格',
  `rules_range` varchar(32) NOT NULL DEFAULT '0' COMMENT '使用范围',
  PRIMARY KEY (`id`),
  UNIQUE KEY `v_id` (`id`),
  KEY `v_nomal` (`appid`,`custom_id`,`stores_id`,`name`,`start_time`,`over_time`,`is_restday`,`rules`,`rules_detail`,`rules_range`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;

