  `stores_address` varchar(32) NOT NULL COMMENT '门店地址',
  `stores_tell` varchar(32) NOT NULL COMMENT '门店电话',
  `state` int(11) NOT NULL DEFAULT '1' COMMENT '1(生效中)2（失效）',
  PRIMARY KEY (`id`),
  UNIQUE KEY `v_idd` (`id`),
  KEY `v_nomal` (`appid`,`custom_id`,`stores_name`,`stores_address`,`stores_tell`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_loop_img`;
CREATE TABLE `xg_loop_img` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `content` text NOT NULL,
  `appid` int(8) NOT NULL DEFAULT '0',
  `custom_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8 COMMENT='轮播图';

DROP TABLE IF EXISTS  `xg_sms_record`;
CREATE TABLE `xg_sms_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `custom_id` int(11) NOT NULL DEFAULT '0',
  `money` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '扣除的金额',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 发送验证码 1 前台发送短信给管理员有新订单 2 管理员创建完普通用户给普通用户发送短信 3 后台发货发送短信通知终端用户',
  `create_time` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='使用管理员的账户发送短信扣除手续费';

DROP TABLE IF EXISTS  `xg_buy_app_num_log`;
CREATE TABLE `xg_buy_app_num_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `custom_id` int(11) NOT NULL COMMENT '用户id',
  `money` decimal(28,2) NOT NULL COMMENT '金额',
  `state` tinyint(4) NOT NULL COMMENT '1已支付',
  `order_sn` varchar(32) NOT NULL COMMENT '订单号',
  `create_time` varchar(32) NOT NULL COMMENT '创建时间',
  `app_num` int(11) NOT NULL COMMENT '购买数量',
  `pay_time` varchar(32) NOT NULL COMMENT '支付时间',
  `type` tinyint(4) NOT NULL COMMENT '0 余额支付 1 微信支付 2 支付宝支付',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_auth_info`;
CREATE TABLE `xg_auth_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `apps` int(8) unsigned NOT NULL DEFAULT '0' COMMENT '商户识别码',
  `nick_name` varchar(32) NOT NULL DEFAULT '' COMMENT '授权方昵称',
  `custom_id` int(11) unsigned NOT NULL DEFAULT '0',
  `type` int(11) NOT NULL COMMENT '小程序类型',
  `appid` char(18) NOT NULL DEFAULT '' COMMENT '授权方appid',
  `access_token` varchar(256) NOT NULL DEFAULT '' COMMENT '令牌，使用需刷新',
  `refresh_token` varchar(64) NOT NULL DEFAULT '' COMMENT '刷新令牌',
  `func_info` varchar(128) NOT NULL DEFAULT '' COMMENT '功能列表',
  `upd_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'access_token更新时间点，两小时须重新刷新获取',
  `head_img` varchar(256) NOT NULL DEFAULT '' COMMENT '授权方头像',
  `service_type_info` smallint(1) unsigned NOT NULL DEFAULT '0' COMMENT '授权方公众号类型，0代表订阅号，1代表由历史老帐号升级后的订阅号，2代表服务号',
  `verify_type_info` smallint(1) unsigned NOT NULL DEFAULT '0' COMMENT '授权方认证类型，-1代表未认证，0代表微信认证，1代表新浪微博认证，2代表腾讯微博认证，3代表已资质认证通过但还未通过名称认证，4代表已资质认证通过、还未通过名称认证，但通过了新浪微博认证，5代表已资质认证通过、还未通过名称认证，但通过了腾讯微博认证',
  `user_name` char(20) NOT NULL DEFAULT '' COMMENT '原始ID',
  `alias` char(32) DEFAULT '' COMMENT '公众号微信号',
  `qrcode_url` varchar(256) NOT NULL DEFAULT '' COMMENT '二维码地址',
  `principal_name` varchar(32) NOT NULL DEFAULT '' COMMENT '主体名称',
  `signature` varchar(256) NOT NULL DEFAULT '' COMMENT '主体简介',
  `is_authorized` smallint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否在授权状态\n0，未授权\n1，已授权',
  `mchid` int(11) unsigned DEFAULT NULL COMMENT '商户号',
  `mkey` varchar(32) NOT NULL DEFAULT '' COMMENT '商户密钥',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='微信公众号授权信息';

DROP TABLE IF EXISTS  `xg_system`;
CREATE TABLE `xg_system` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(32) NOT NULL DEFAULT '',
  `password` varchar(32) NOT NULL DEFAULT '',
  `lastIp` varchar(32) NOT NULL DEFAULT '',
  `nowIp` varchar(32) NOT NULL DEFAULT '',
  `lastTime` varchar(32) NOT NULL DEFAULT '',
  `nowTime` varchar(32) NOT NULL DEFAULT '',
  `is_agency_user` tinyint(1) NOT NULL COMMENT '是否是代理  1是',
  `custom_id` int(11) DEFAULT NULL COMMENT '代理商id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

DROP TABLE IF EXISTS  `xg_subscribe_cate`;
CREATE TABLE `xg_subscribe_cate` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL DEFAULT '',
  `code` int(11) unsigned NOT NULL DEFAULT '0',
  `appid` int(8) unsigned NOT NULL DEFAULT '0',
  `custom_id` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_form_list`;
CREATE TABLE `xg_form_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0',
  `openid` varchar(32) NOT NULL,
  `form_id` varchar(32) NOT NULL COMMENT '前台用户触发一此form或支付就会生成一个form_id 用于发模板',
  `create_time` int(11) NOT NULL,
  `appid` int(8) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4843 DEFAULT CHARSET=utf8 COMMENT='用户的所有的form_id和parpay_id用来发送消息';

DROP TABLE IF EXISTS  `xg_recharge`;
CREATE TABLE `xg_recharge` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `custom_id` int(11) NOT NULL,
  `money` decimal(10,3) NOT NULL DEFAULT '0.000',
  `order_sn` varchar(20) NOT NULL COMMENT '订单号',
  `create_time` int(11) NOT NULL,
  `pay_time` int(11) NOT NULL COMMENT '支付成功时间',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 微信扫码,1支付宝',
  `state` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1支付成功',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='后台用户的充值记录表';

DROP TABLE IF EXISTS  `xg_system_sms`;
CREATE TABLE `xg_system_sms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `is_mobile` smallint(1) NOT NULL DEFAULT '0',
  `appid` varchar(16) NOT NULL DEFAULT '',
  `appsecret` varchar(16) NOT NULL DEFAULT '',
  `is_mail` smallint(1) NOT NULL DEFAULT '0',
  `mail_server` varchar(255) NOT NULL DEFAULT '',
  `mail_port` smallint(5) NOT NULL DEFAULT '0',
  `mail_user` varchar(255) NOT NULL DEFAULT '',
  `mail_password` varchar(255) NOT NULL DEFAULT '',
  `sms_money` decimal(10,3) NOT NULL DEFAULT '0.000',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

DROP TABLE IF EXISTS  `xg_dist_rule`;
CREATE TABLE `xg_dist_rule` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `custom_id` int(11) NOT NULL DEFAULT '0' COMMENT '哪个管理员设置的分销',
  `appid` int(8) NOT NULL DEFAULT '0' COMMENT '小程序的appid',
  `switch` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 当前小程序的分销未开启',
  `level` tinyint(1) NOT NULL DEFAULT '0' COMMENT '当前的分销设置的基层',
  `scale` varchar(125) NOT NULL COMMENT '分销的比例，设置几层就有几层的分销比例，使用，隔开',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 全部商品参与分销 1 部分商品参与分销',
  `good_list` varchar(255) NOT NULL COMMENT '如果部分商品参与分销，商品id使用，隔开',
  `is_withdraw` tinyint(1) NOT NULL DEFAULT '0' COMMENT '分销是向上级分销，这是上级就有了分销金额，这个金额设置是否可以提现 0 不可以 1 可以',
  `withdraw_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '提现方式 0 全部都可以 1 支付宝2 银行卡 ',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='分销的规则';

DROP TABLE IF EXISTS  `xg_subscribe_service_user`;
CREATE TABLE `xg_subscribe_service_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(125) NOT NULL DEFAULT ' ' COMMENT '姓名',
  `desc` text NOT NULL COMMENT '简介',
  `pic` varchar(255) NOT NULL DEFAULT ' ',
  `service_id` varchar(125) NOT NULL,
  `appid` int(11) NOT NULL DEFAULT '0',
  `custom_id` int(11) NOT NULL DEFAULT '0',
  `service_name` varchar(225) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `u_id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_buy_app_log`;
CREATE TABLE `xg_buy_app_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `custom_id` int(11) NOT NULL,
  `appid` int(8) NOT NULL,
  `money` decimal(10,3) NOT NULL DEFAULT '0.000',
  `order_sn` varchar(32) NOT NULL,
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '0 余额支付 1 微信支付 2 支付宝支付',
  `state` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1支付成功',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `pay_time` int(11) NOT NULL DEFAULT '0',
  `year_num` int(11) NOT NULL COMMENT '使用年限',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=63 DEFAULT CHARSET=utf8 COMMENT='后台用户购买小程序的消费记录';

DROP TABLE IF EXISTS  `xg_stores_setmeal`;
CREATE TABLE `xg_stores_setmeal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(11) NOT NULL COMMENT '小程序id',
  `number` int(11) NOT NULL DEFAULT '1' COMMENT '可以添加的门店数量',
  `surplus_number` int(11) NOT NULL DEFAULT '1' COMMENT '剩余添加门店数量',
  `set_meal` varchar(32) NOT NULL COMMENT '门店套餐',
  `probation_start` int(11) NOT NULL COMMENT '试用期开始时间',
  `probation_end` int(11) NOT NULL COMMENT '试用期结束时间',
  `price` varchar(32) NOT NULL COMMENT '价格',
  `state` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态0（生效中）1（失效）',
  `use_time` int(11) NOT NULL COMMENT '使用开始时间',
  `use_end_time` int(11) NOT NULL COMMENT '使用结束时间',
  `is_pay` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否支付0（未支付）',
  `is_message` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否推送支付订单1（未推送）2（已推送）',
  UNIQUE KEY `v_id` (`id`),
  KEY `v_nomal` (`appid`,`number`,`set_meal`,`surplus_number`),
  KEY `v_nomals` (`price`,`state`,`use_time`,`use_end_time`,`is_pay`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_stores_style`;
CREATE TABLE `xg_stores_style` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(11) NOT NULL COMMENT 'appid',
  `custom_id` int(11) NOT NULL COMMENT '用户id',
  `slogan` varchar(255) NOT NULL COMMENT '标语',
  `pic` varchar(255) NOT NULL COMMENT '封面图片',
  PRIMARY KEY (`id`),
  UNIQUE KEY `v_id` (`id`,`appid`),
  KEY `v_noaml` (`custom_id`,`slogan`,`pic`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `xg_app`;
CREATE TABLE `xg_app` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appid` int(8) NOT NULL DEFAULT '0',
  `custom_id` int(11) NOT NULL DEFAULT '0',
  `setting_id` int(11) NOT NULL COMMENT '套餐id',
  `name` varchar(255) NOT NULL DEFAULT '',
  `pic` varchar(255) NOT NULL DEFAULT '',
  `type` smallint(2) NOT NULL DEFAULT '0',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `try_time` int(11) NOT NULL DEFAULT '0',
  `use_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '这个小程序总共花费的钱数总和',
  `desc` varchar(255) NOT NULL DEFAULT '' COMMENT '简介',
  `tel` varchar(32) NOT NULL DEFAULT '',
  `site_url` varchar(255) NOT NULL DEFAULT '',
  `address` varchar(255) NOT NULL DEFAULT '',
  `is_publish` smallint(1) NOT NULL DEFAULT '0' COMMENT '0 未发布 1 已绑定 2 已上传代码 3 审核中，4 已上线 5已下线',
  `is_del` smallint(1) NOT NULL DEFAULT '0' COMMENT '0没有删除 1 删除',
  `notifytel` char(11) NOT NULL COMMENT '通知的手机号',
  `notifyemail` char(40) NOT NULL COMMENT '通知的邮箱',
  `theme` smallint(2) unsigned NOT NULL DEFAULT '0' COMMENT '主题色',
  `layout` smallint(2) unsigned NOT NULL DEFAULT '0' COMMENT '商品布局',
  `search` smallint(1) unsigned NOT NULL DEFAULT '1',
  `on_service` smallint(1) unsigned NOT NULL DEFAULT '0',
  `over_time` varchar(10) NOT NULL COMMENT '营业结束时间',
  `start_time` varchar(10) NOT NULL COMMENT '营业开始时间',
  `business` smallint(1) unsigned NOT NULL DEFAULT '1' COMMENT '周六周天是否营业\n1(不营业)2（营业）',
  `is_forbidden` smallint(1) NOT NULL COMMENT '当前小程序是否禁用，在总后台设置',
  `id_agency` int(11) NOT NULL DEFAULT '0' COMMENT '代理商id  用于代理商普通用户添加的小程序的辨识',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=258 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

SET FOREIGN_KEY_CHECKS = 1;

